import React, { Component } from 'react';
import Square from './components/Square';
class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
    };
  }

  render() {
    return (
      <div id="main">
        <Square Id="P1" latlng={{latitude:0.0,longitude:0.0}} size={{width:'2.5%',height:'2.5%'}} colour="#00ff02"/>
        <Square Id="P2" latlng={{latitude:0.0,longitude:0.0}} size={{width:'2.5%',height:'2.5%'}} colour="#00ff02"/>
        <Square Id="P3" latlng={{latitude:0.0,longitude:0.0}} size={{width:'2.5%',height:'2.5%'}} colour="#00ff02"/>
        <Square Id="P4" latlng={{latitude:0.0,longitude:0.0}} size={{width:'2.5%',height:'2.5%'}} colour="#00ff02"/>
        <Square Id="P5" latlng={{latitude:0.0,longitude:0.0}} size={{width:'2.5%',height:'2.5%'}} colour="#00ff02"/>
        <Square Id="P6" latlng={{latitude:0.0,longitude:0.0}} size={{width:'2.5%',height:'2.5%'}} colour="#00ff02"/>
      </div>
    );
  }
}

export default App;
